import React from 'react';
import ImageEditor from '../components/ImageEditor';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import UserHistoryComponent from '../components/UserHistoryComponent';

const AcneDetectionPage = () => {
    return (
        <>
        <Navbar/>
      <div className="container py-5">
        <h2 className="text-center mb-4">Find out the acne on you skin</h2>
        
        <ImageEditor /> {/* Add the ImageEditor component */}
        <UserHistoryComponent/>
      </div>
      <Footer/>
      </>
    );
};

export default AcneDetectionPage;
